static int yy_init_globals (void)
{
        /* Initialization is the same as for the non-reentrant scanner.
     * This function is called from sverilog_lex_destroy(), so don't allocate here.
     */

    /* We do not touch sverilog_lineno unless the option is enabled. */
    sverilog_lineno =  1;
    
    (yy_buffer_stack) = 0;
    (yy_buffer_stack_top) = 0;
    (yy_buffer_stack_max) = 0;
    (yy_c_buf_p) = (char *) 0;
    (yy_init) = 0;
    (yy_start) = 0;

    (yy_state_buf) = 0;
    (yy_state_ptr) = 0;
    (yy_full_match) = 0;
    (yy_lp) = 0;

/* Defined in main.c */
#ifdef YY_STDINIT
    sverilog_in = stdin;
    sverilog_out = stdout;
#else
    sverilog_in = (FILE *) 0;
    sverilog_out = (FILE *) 0;
#endif

    /* For future reference: Set errno on error, since we are called by
     * sverilog_lex_init()
     */
    return 0;
}

/* sverilog_lex_destroy is for both reentrant and non-reentrant scanners. */
int sverilog_lex_destroy  (void)
{
    
    /* Pop the buffer stack, destroying each element. */
	while(YY_CURRENT_BUFFER){
		sverilog__delete_buffer(YY_CURRENT_BUFFER  );
		YY_CURRENT_BUFFER_LVALUE = NULL;
		sverilog_pop_buffer_state();
	}

	/* Destroy the stack itself. */
	sverilog_free((yy_buffer_stack) );
	(yy_buffer_stack) = NULL;

    sverilog_free ( (yy_state_buf) );
    (yy_state_buf)  = NULL;

    /* Reset the globals. This is important in a non-reentrant scanner so the next time
     * sverilog_lex() is called, initialization will occur. */
    yy_init_globals( );

    return 0;
}

